  function handleButtonDelete(){

  }

  return (
    <Card
        sx={{marginTop:"20px"}}
    >
    <CardActionArea href="https://google.com">

      <CardMedia
        component="img"
      />

      <CardContent>
        <Typography gutterBottom variant="h5" component="div">
          {article.title}
        </Typography>
        <Typography variant="body2" color="text.secondary">
          {article.description}
        </Typography>
      </CardContent>

      <CardActions>

        <Button 
            size="small"
            onClick={handleButtonLearnMore}
        >
            Learn More
        </Button>

        <Button size="small" onClick={handleButtonDelete}>Delete</Button>
      </CardActions>
    </CardActionArea>

    </Card>
  );
}
